import React from 'react';
import { Route, Switch } from 'react-router-dom';

const Section = ({ routes }) => {
    return (
        <Switch>
           {  routes.map((route) =><Route keypath={route.path} exact component={route.component} />) }
        </Switch>
    )
}

export default Section;
